import Food from './component/food/Food';
import { BrowserRouter as Router,Routes,Route } from 'react-router-dom';
import Addtocart from './component/addtocart/Addtocart';
import Test from './component/test/Test';
function App() {

  return (
      <div >
      {/* <Login/> */}
     {/* <Test/> */}
      {/* <Food/> */}
{/* <Addtocart/> */}
{/* <Test/> */}
    <Router>
      <Routes>
